import React from "react";
import Grid from "@mui/material/Grid";
import "./Dashboard.scss";

const Dashboard: React.FC = () => {
  return (
    <Grid container spacing={2}>
      {[...Array(6)].map((_, index) => (
        <Grid item xs={12} sm={6} md={4} key={index}>
          <h2 className='MuiTypography-root MuiTypography-h2 MuiTypography-gutterBottom MuiTypography-alignCenter dashboard-section__title'>
            Dashboard
          </h2>
          <div>Блок {index + 1}</div>
        </Grid>
      ))}
    </Grid>
  );
};

export default Dashboard;
